import React from "react";

function Note() {
  const people = [
    { id: 1, name: 'chris' },
    { id: 2, name: 'nick' }
  ];
  return (
    <div>
    {people.map(person => (
        <h2  className="note" key={person.id}>{person.name}</h2>
      ))}

    </div>
  );
}

export default Note;
